# Fonction pour dessiner une partie de l'image
def dess_part(im):
    r, i = 0, 0
    while r < len(im):
        s = im[r]
        if not ("A" <= s <= "Z"):  # V√©rifier si c'est une lettre valide
            r += 1
            continue

        n = ""
        r += 1
        while r < len(im) and "0" <= im[r] <= "9":  # Extraire le nombre
            n += im[r]
            r += 1

        nb = int(n) if n else 1  # Valeur par d√©faut si pas de nombre
        idx = ord(s) - 65  # Convertir la lettre en index
        
        if 0 <= idx < len(pal):  # Emp√™cher les erreurs d'index
            c = pal[idx]
            for _ in range(nb):
                x, y = i % 320, i // 320  # Ajustement pour 320x240
                if y < 240:  # Ne pas d√©passer l'√©cran
                    fill_rect(x, y, 1, 1, (c[0], c[1], c[2]))
                i += 1

# Traiter chaque morceau individuellement
for part in im_parts:
    dess_part(part)
